import React from "react";
import "./Header.css";
const Header = ({ isLoggedIn, setLoggedIn }) => {
  return (
    <div className="header">
      <p>dashboard</p>
      {isLoggedIn ? (
        <p>You are logged in</p>
      ) : (
        <button type="button">login</button>
      )}
    </div>
  );
};

export default Header;
